import React, { useState } from "react";

const App = () => {
  const [value, setValue] = useState("");
  const onChangeHandler = (event) => {
    const inputValue = event.target.value;
    setValue(inputValue);
  };

  return (
    <div>
      <input type="text" onchange={onChangeHandler} value={value} />
    </div>
  );
};

export default App;
